DROP TABLE IF EXISTS `productinstore`;
CREATE TABLE `productinstore` (
  `ProductInStoreId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键自动生成',
  `ProductInStoreNo` varchar(50) NOT NULL COMMENT '入单号',
  `OrderDate` datetime NOT NULL COMMENT '入库日期',
  `ProviderId` bigint(20) DEFAULT NULL COMMENT '客户编号(也可能是供应商),如果是供应商,就是采购入库,如果是客户,就是退货入库',
  `ProviderName` varchar(256) DEFAULT NULL COMMENT '客户名称',
  `Status` int(11) DEFAULT NULL COMMENT '入库单状态1=作废,2=待入库,5=已入库',
  `CreateId` bigint(20) NOT NULL COMMENT '开单人ID',
  `CreateName` varchar(35) DEFAULT NULL COMMENT '开单人名字',
  `Expresser` varchar(125) DEFAULT NULL COMMENT '送货人',
  `DeliveryRemark` varchar(200) DEFAULT NULL COMMENT '运输车牌号,如果是走物流,则是运单号',
  `IsPickUp` bit(1) NOT NULL COMMENT '是否自提',
  `PickProviderId` bigint(20) DEFAULT NULL COMMENT '物流商',
  `PickProviderName` varchar(50) DEFAULT NULL COMMENT '物流商',
  `EmployeeId` bigint(20) DEFAULT NULL COMMENT '库管员',
  `EmployeeName` varchar(1024) DEFAULT NULL COMMENT '库管员名字',
  `SourceType` varchar(50) DEFAULT NULL COMMENT '来源',
  `SourceId` varchar(50) DEFAULT NULL COMMENT '来源主键',
  `SourceOrderName` varchar(50) DEFAULT NULL COMMENT '来源编号',
  `ProductHouseId` bigint(20) NOT NULL COMMENT '仓库编号',
  `ProductHouseName` varchar(50) DEFAULT NULL COMMENT '仓库名称',
  `Remark` varchar(200) DEFAULT NULL COMMENT '说明',
  `TotalAmount` decimal(21,4) NOT NULL DEFAULT 0.0000 COMMENT '总金额',
  `DeliveryAmount` decimal(21,4) NOT NULL DEFAULT 0.0000 COMMENT '总运费',
  `CreateTime` datetime NOT NULL COMMENT '记录添加时间',
  `IsView` bit(1) NOT NULL COMMENT '是否可见',
  `Info1` bigint(20) DEFAULT NULL COMMENT '信息1',
  `ModifyMark` text DEFAULT NULL,
  `Info2` bigint(20) DEFAULT NULL COMMENT '信息2',
  `Info3` decimal(21,2) DEFAULT NULL COMMENT '信息3',
  `Info4` decimal(21,2) DEFAULT NULL COMMENT '信息4',
  `Info5` varchar(20) DEFAULT NULL COMMENT '信息5',
  `Info6` varchar(20) DEFAULT NULL COMMENT '信息6',
  `Info7` varchar(50) DEFAULT NULL COMMENT '信息7',
  `Info8` varchar(50) DEFAULT NULL COMMENT '信息8',
  `Info9` varchar(1024) DEFAULT NULL COMMENT '信息9',
  `Info10` varchar(1024) DEFAULT NULL COMMENT '信息10',
  `InvoiceStatus` int(11) DEFAULT 1,
  `PayedAmount` decimal(21,2) DEFAULT NULL,
  `WaitApplyAmount` decimal(21,2) DEFAULT NULL,
  `CompanyId` varchar(50) NOT NULL DEFAULT '1' COMMENT '公司编号',
  PRIMARY KEY (`ProductInStoreId`)
) ENGINE=InnoDB AUTO_INCREMENT=3461 DEFAULT CHARSET=utf8 COMMENT='入库单';

